import React from 'react'
import PropTypes from 'prop-types'
import {AllTickets} from '../HuddleComponents/AllTickets.js';
import {getAllProjects} from '../HuddleComponents/AllTickets.js';
export default function LeftNav(props) {
    const onDelete = (particularTicket)=>{
        console.log("I am ticket of",particularTicket);
    };
    let allTickets = [
        {
          sno:1,
          title : "Need a new server",
          description: "we need a new development server"
        },
        {
          sno:2,
          title : "Need a new memory",
          description: "we need a new development server"
        },
        {
          sno:3,
          title : "Need a new hdd",
          description: "we need a new development server"
        },
        {
          sno:4,
          title : "Need a new ssd",
          description: "we need a new development server"
        },
        {
          sno:5,
          title : "Need a new laptop",
          description: "we need a new development server"
        },
      ]
    return (
        <div className="d-flex align-items-start">
            <div className="nav flex-column nav-pills me-3" id="v-pills-tab" role="tablist" aria-orientation="vertical">
                <button className="nav-link active" id="v-pills-home-tab" data-bs-toggle="pill" data-bs-target="#v-pills-home" type="button" role="tab" aria-controls="v-pills-home" aria-selected="true">All tickets</button>
                <button className="nav-link" id="v-pills-profile-tab" data-bs-toggle="pill" data-bs-target="#v-pills-profile" type="button" role="tab" aria-controls="v-pills-profile" aria-selected="false">Create ticket</button>
                <button className="nav-link" id="v-pills-messages-tab" data-bs-toggle="pill" data-bs-target="#v-pills-messages" type="button" role="tab" aria-controls="v-pills-messages" aria-selected="false">Members</button>
                <button className="nav-link" id="v-pills-settings-tab" data-bs-toggle="pill" data-bs-target="#v-pills-settings" type="button" role="tab" aria-controls="v-pills-settings" aria-selected="false">Buckets Available</button>
            </div>
            <div className="tab-content" id="v-pills-tabContent">
                <div className="tab-pane fade show active" id="v-pills-home" role="tabpanel" aria-labelledby="v-pills-home-tab"><AllTickets allTheTickets = {allTickets} onDelete={onDelete}/></div>
                <div className="tab-pane fade" id="v-pills-profile" role="tabpanel" aria-labelledby="v-pills-profile-tab">...</div>
                <div className="tab-pane fade" id="v-pills-messages" role="tabpanel" aria-labelledby="v-pills-messages-tab">...</div>
                <div className="tab-pane fade" id="v-pills-settings" role="tabpanel" aria-labelledby="v-pills-settings-tab">...</div>
            </div>
        </div>
    )
}
